import React from 'react';
import { Outlet } from 'react-router-dom';
import Header from '../Header';  // adjust the import path as per your project structure
import Sidebar from '../Sidebar';  // adjust the import path as per your project structure

const MainLayout = () => {
  return (
    <div className="layout-wrapper">
      <Header />
      <Sidebar />
      <div className="layout-content">
        <Outlet />
      </div>
    </div>
  );
};

export default MainLayout;
